import React from 'react';
import { connect } from "react-redux";
import * as creator from '../store/actions/itineraryActions';
import PreNavbar from '../components/PreNavbar';
import Sidebar from '../components/Sidebar';

class CityPage extends React.Component {

    componentDidMount() {
        this.props.getCity(window.location.pathname.replace("/", ""));
        console.log(this.props);
    }

    render() {
        return (
            <div>
                <Sidebar />
                <PreNavbar />
                <div className="contentItinery">
                    <img className="cityImage" src="https://wallpapercave.com/wp/wp1826140.jpg" alt="city wallpaper"></img>
                    <h1>Moskau</h1>
                    <div className="itinery">
                        <img className="profileImage" src="https://immedilet-invest.com/wp-content/uploads/2016/01/user-placeholder.jpg"></img>
                        <p>Gaudi Lover</p>
                        <p className="statusText">Gaudi in a day</p>
                    </div>
                </div>
            </div>
        );
    }
}

const mapStateToProps = state => {
    return {city: state, cityIsLoading: state.cityIsLoading};
}

const mapDispatchToProps = dispatch => {
    return {
        getCity: name => dispatch(creator.fetchCityData(name)),
    }
}

export default connect(mapStateToProps, mapDispatchToProps) (CityPage);
